import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { handleSuccess, handleError, ToastContainer } from '../../utils/ReactToastify';
import '../../assets/style/styleutils/ReactToastifyCustom.css';
import '../../assets/style/Authentication/ResetPassword.css';
import PasswordStrengthMeter from '../../Extension/PasswordStrengthMeter'; // Import the PasswordStrengthMeter component

function ResetPassword() {
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [passwordError, setPasswordError] = useState(false);
    const [confirmPasswordError, setConfirmPasswordError] = useState(false);
    const [matchError, setMatchError] = useState(false); // New state for match error
    const { state } = useLocation();
    const navigate = useNavigate();

    const handleSubmit = async (event) => {
        event.preventDefault();
        let hasError = false;

        // Validate inputs
        if (!password) {
            setPasswordError(true);
            hasError = true;
        } else {
            setPasswordError(false);
        }

        if (!confirmPassword) {
            setConfirmPasswordError(true);
            hasError = true;
        } else {
            setConfirmPasswordError(false);
        }

        if (password !== confirmPassword) {
            setMatchError(true); // Set match error
            handleError('Passwords do not match');
            hasError = true;
        } else {
            setMatchError(false); // Clear match error if passwords match
        }

        if (hasError) return;

        try {
            const response = await fetch('http://localhost:8080/verification/reset-password', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ email: state.email, newPassword: password }),
            });

            const result = await response.json();

            if (response.ok) {
                handleSuccess(result.message);
                navigate('/login');
            } else {
                handleError(result.message);
            }
        } catch (err) {
            handleError('Network error. Please check your connection and try again.');
        }
    };

    return (
        <div className="reset-password-container fade-in-bottom">
            <svg xmlns="http://www.w3.org/2000/svg" width="48" height="48" fill="#5E5CE6" className="bi bi-stars login-page-app-icon animate-stars" viewBox="0 0 16 16">
                        <path d="M7.657 6.247c.11-.33.576-.33.686 0l.645 1.937a2.89 2.89 0 0 0 1.829 1.828l1.936.645c.33.11.33.576 0 .686l-1.937.645a2.89 2.89 0 0 0-1.828 1.829l-.645 1.936a.361.361 0 0 1-.686 0l-.645-1.937a2.89 2.89 0 0 0-1.828-1.828l-1.937-.645a.361.361 0 0 1 0-.686l1.937-.645a2.89 2.89 0 0 0 1.828-1.828zM3.794 1.148a.217.217 0 0 1 .412 0l.387 1.162c.173.518.579.924 1.097 1.097l1.162.387a.217.217 0 0 1 0 .412l-1.162.387A1.73 1.73 0 0 0 4.593 5.69l-.387 1.162a.217.217 0 0 1-.412 0L3.407 5.69A1.73 1.73 0 0 0 2.31 4.593l-1.162-.387a.217.217 0 0 1 0-.412l1.162-.387A1.73 1.73 0 0 0 3.407 2.31zM10.863.099a.145.145 0 0 1 .274 0l.258.774c.115.346.386.617.732.732l.774.258a.145.145 0 0 1 0 .274l-.774.258a1.16 1.16 0 0 0-.732.732l-.258.774a.145.145 0 0 1-.274 0l-.258-.774a1.16 1.16 0 0 0-.732-.732L9.1 2.137a.145.145 0 0 1 0-.274l.774-.258c.346-.115.617-.386.732-.732z"/>
                    </svg>
            <button
                className="back-button-forgotpaass icon-button fade-in"
                onClick={() => navigate('/sent-otp-forgot-password')} // Navigate to SentOtpForgotPassword page
            >
                <img src="/images/icon/back-icon.png" alt="Back" />
            </button>
        
            <h1 className="fade-in">Reset Password</h1>
            <form onSubmit={handleSubmit}>
                <div className={`input-wrapper ${matchError ? 'error' : ''} fade-in`}>
                    <div className={`form-group-reset-password ${passwordError ? 'error' : ''}`}>
                        <input
                            type='password'
                            id='new-password'
                            placeholder=''
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                        <label htmlFor='new-password' className='form-label-reset-password'>New password</label>
                    </div>
                    <div className={`form-group-reset-password ${confirmPasswordError ? 'error' : ''}`}>
                        <input
                            type='password'
                            id='confirm-password'
                            placeholder=''
                            value={confirmPassword}
                            onChange={(e) => setConfirmPassword(e.target.value)}
                            required
                        />
                        <label htmlFor='confirm-password' className='form-label-reset-password'>Confirm Password</label>
                    </div>
                    <PasswordStrengthMeter password={password} /> 
                </div>
                <button type="submit" className="scale-in">Reset Password</button>
            </form>
            <ToastContainer />
        </div>
    );
}

export default ResetPassword;
